import React from 'react'
import Navbar from 'react-bootstrap/NavBar'
import Nav from 'react-bootstrap/Nav'
import Form from 'react-bootstrap/Form'
import FormControl from 'react-bootstrap/FormControl'
import Button from 'react-bootstrap/Button'

export default class NavBarComponent extends React.Component {
    state = {
        username: "",
        password: "",
        name: "",
        results: []
    }

    handleLogin = (event) => {
        console.log('login selected')
    }

    handleChange = (event) => {


    }

    userIsLoggedIn = () => {
        return (
            <>
            <Nav className='mr-auto'></Nav>
            <Nav className='mr-auto'>
                <Nav.Link>Username Here</Nav.Link>
            </Nav>
            <Nav className='mr-auto'>
                <Button variance='outline-info'>Log Out</Button>
            </Nav>
            </>
        )

    }

    userNotLoggedIn = () => {
        return (
            <Form inline>
                <FormControl type='text' placeholder='UserName' className='mr-sm-2' />
                <FormControl type='password' placeholder='Password' className='mr-sm-2' />
                <Button variant='outline-info'>Log In</Button>
            </Form>
        )
    }

    render() {
        return( 
        <>
            <Navbar bg='dark' variant='dark' className='justify-content-between'>
                <Navbar.Brand>Andrew's React Test App</Navbar.Brand>
                {this.state.name ? <this.userIsLoggedIn /> : <this.userNotLoggedIn />}
            </Navbar>




        </>
        )
    }


}
